import { makeStyles } from '@material-ui/styles';
import React from 'react';

const useStyles = makeStyles({
    container: {
        display: "flex",
        justifyContent: "center",
        alignItems: "center"
    }
})

const PageNotFound = () => {
    return <div><img src="https://image.freepik.com/free-vector/404-error-page-found-illustration_1124-691.jpg" alt="Page Not Found" /></div>
}

export default PageNotFound;
